import './App.css';

function App() {
  return (
    <div className="App">

      <Fragment><h1 id = "line">my name is: {50000} </h1>
      <h2> my family name is: {8+8+5} </h2> 

      <table style={{width:'300px'}}> 
        <tr> 
          <th>Name:</th>
          <th>Gander:</th>
          <th>DateOfBirth:</th>
        </tr>
       </table>


      </Fragment>

    </div>
  );
}

export default App;
